import { Expenses } from "../Types";
import { useEffect, useState } from "react";

const Calculator = () => {
  let [expenses, setExpenses] = useState<Expenses[]>([]);

  expenses = [
    {
      id: Date.now(),
      category: "가아아",
      money: 2000,
    },
    {
      id: Date.now(),
      category: "가아아",
      money: 3000,
    },
    {
      id: Date.now(),
      category: "가아아",
      money: 4000,
    },
  ];

  let sum: number = 0;
  for (let i = 0; i < expenses.length; i++) {
    sum += expenses[i].money;
    console.log(sum);
  }
  useEffect(() => {
    console.log(sum);
  }, []);

  return <span>{sum}</span>;
};

export default Calculator;
